import React, {Component} from 'react';
import {Card, CardText, CardBody, CardLink, CardTitle, CardSubtitle} from 'react-bootstrap';
import Button from 'react-bootstrap/Button'

class List extends Component {
  constructor(props) {
  super(props);
  // Don't call this.setState() here!
  this.state = {};
  this.handleClick = this.handleClick.bind(this);
}
  renderList() {
    const items = this.props.items.map(item => {
      return (
        <div key={item.name} xs ={10} md = {10}>
        <h1>
        {item.name}
        </h1>
          <img src={item.img}/>
        </div>
      )
    });

    return items;
  }

  render() {

    return (
      <div>
      <ul class = "grid">
        {this.renderList()}
      </ul>

      <div>
      <Card>
      <Card.Body>
      <Card.Title><h2>{item.name}</h2></Card.Title>
      <Card.Subtitle> ${item.price.toFixed(2)}</Card.Subtitle>
      <Button onClick={()=>this.props.onAggregatorAdd(item)}> Add</Button>
      <Button onClick={()=>this.props.onAggregatorRemove(item)}> Remove</Button>
      </Card.Body>
      </Card>
      </div>
      </div>

    );
  }
}

export default List;
